import React from 'react'
import styled from 'styled-components'
const Header = () => {
  return (
    <div>
        <header>
            <StLogo><img src="//contents-image.twayair.com/homepage/images/main/top_logo.png" alt="" /></StLogo>
            <nav></nav>
        </header>
    </div>
  )
}

export default Header

const StLogo = styled.h1`
    width: 101px;
    height: 42px;
`
